import Card from './Card';

function App() {
  return (
    <div className="App">
      <h1>Hello</h1>
      <Card name='Himanshu' workstatus="Working"> <button class="button">Green</button>
        <button class="button button2">Blue</button>
        <button class="button button3">Red</button></Card>
      <Card name='Ankush' workstatus="Working" />
      <Card name='Afsar' workstatus="Learning React" />
    </div>
  );
}

export default App;
